package com.mall.model;import com.yanbao.core.model.SimpleModel;/** * Title:PayCallback * Description:支付回调记录Po类 * Copyright: Copyright (c) 2017 * Company: 炎宝科技 * * @author Pay - 1091945691@qq.com * @version v1.0 2017-05-26 */public class PayCallback extends SimpleModel {    /**     * 类的版本号     */    private static final long serialVersionUID = 2195613345211744L;    /**  */    private String userId;    /**  */    private String orderNo;    /**  */    private String uri;    /**  */    private Integer payWay;    /**  */    private String param;    public String getUserId() {        return userId;    }    public void setUserId(String userId) {        this.userId = userId;    }    public String getOrderNo() {        return orderNo;    }    public void setOrderNo(String orderNo) {        this.orderNo = orderNo;    }    public String getUri() {        return uri;    }    public void setUri(String uri) {        this.uri = uri;    }    public Integer getPayWay() {        return payWay;    }    public void setPayWay(Integer payWay) {        this.payWay = payWay;    }    public String getParam() {        return param;    }    public void setParam(String param) {        this.param = param;    }    public String toString() {        return "[" + "id:" + getId() + "," + "userId:" + getUserId() + "," + "orderNo:" + getOrderNo() + "," + "uri:" + getUri() + "," + "payWay:" + getPayWay() + "," + "param:" + getParam() + "," + "createTime:" + getCreateTime() + "," + "updateTime:" + getUpdateTime() + "," + "status:" + getStatus() + "," + "remark:" + getRemark() + "]";    }}